import React from 'react'
import './heading.css';
import me from '../res/me.png';
import star from '../res/star.gif';

function Header() {
  return (
    <header className='background'>
      <div className='box'>
        <div className='first-row'>
          <img src={me} className='stanley'/>
          <p className='intro'>HI. I'M STANLEY.<br/>I'M A PASSIONATE SOFTWARE DEVELOPER.</p>
        </div>
        <div className='second-row'>
          <img src={star} className='star'/>
          <p className='special'>Currently at the University of Waterloo studying Computer Science!</p>
        </div>
      </div>
    </header>
  );
};

export default Header
